import React from "react";
import MeetUpItem from "./MeetUpItem";

const MeetUpList = (props) => {
    return (<>

        <ul>
            {
                props.meetups.map((meetup) => {
                    <MeetUpItem
                        id={meetup.id}
                        key={meetup.id}
                        image={meetup.image}
                        title={meetup.title}
                        discription={meetup.discription}
                        address={meetup.address}

                    />
                })
            }
        </ul>
    </>
    );
}
export default MeetUpList;
